import { useEffect, useState } from 'react'
import getMovieCredits from '../../services/getMovieCredits'


export function useMovieCredits(id) {
    const [actors, setActor] = useState([])


    useEffect(() => {   
        getMovieCredits({ id })
            .then(elements => {
              setParameter(elements)
            }) 
    }, [id]) 


    return actors
}
